import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {
  const [file, setFile] = useState(null);
  const [numThreads, setNumThreads] = useState(4);
  const [results, setResults] = useState([]);
  const [res, setRes] = useState(false);
  const [executionChoice, setExecutionChoice] = useState('mpi'); // Default execution choice: MPI
  const [hadopResult,setHadopResult]=useState('');
  const [OpenmpResult,setOpenmpResult]=useState('');
  const [mpiResult,setmpiResult]=useState('');
  const[visibMpi,setVisibMpi]=useState(false);
  const[visibOpenmp,setVisibOpenmp]=useState(false);
  const[visibHadoop,setVisibHadoop]=useState(false);
  const [finalResult,setFinalResult]=useState('');
  const [threadResults,setThreadResults]=useState('');

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const handleNumThreadsChange = (event) => {
    setNumThreads(parseInt(event.target.value));
  };

  const handleExecutionChoiceChange = (event) => {
    setExecutionChoice(event.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await axios.post(`http://localhost:3001/process?threads=${numThreads}&execution=${executionChoice}`, formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      switch (executionChoice) {
        case 'mpi':
          // Code à exécuter si choice vaut 'option1'
          console.log('Option 1 selected');
          setmpiResult(response.data.results);
          setVisibMpi(true);

          break;
        case 'openmp':

        setOpenmpResult(response.data.results);
        setVisibOpenmp(true);

        // Obtenir le résultat final
        const finalOpenmpResult = response.data.results.find(result => result['Final Result']);
        setFinalResult(finalOpenmpResult);

        // Obtenir les résultats pour chaque thread
        const threadResultsOpenmp = response.data.results.filter(result => !result['Final Result']);
        setThreadResults(threadResultsOpenmp);

        break;
        case 'hadoop':
          setHadopResult(response.data.results);
          setVisibHadoop(true);
          // Code à exécuter si choice vaut 'option3'
          console.log('Option 3 selected');
          break;
        default:
          console.log('Default option');
          break;
      }
      setResults(response.data.results);
      setRes(true);
    } catch (error) {
      console.error('Error:', error);
      // Handle the error here
    }
  };

  return (
    <div className="container">
      <form onSubmit={handleSubmit} className="form">
        <input type="file" onChange={handleFileChange} className="form-control" />
        <input type="number" value={numThreads} onChange={handleNumThreadsChange} className="form-control" />

        <label>
          Choose execution type:
          <select value={executionChoice} onChange={handleExecutionChoiceChange} className="form-control">
            <option value="mpi">MPI</option>
            <option value="openmp">OpenMP</option>
            <option value="hadoop">Hadoop</option>
          </select>
        </label>

        <button type="submit" className="btn btn-primary">Submit</button>
      </form>

      {visibOpenmp && ( 
  <div>
  {data.results.map((thread, index) => (
    <div key={index}>
      <h2>Thread {index}</h2>
      <table>
        <thead>
          <tr>
            <th>Key</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
          {Object.entries(thread[`Thread ${index}`]).map(([key, value], i) => (
            <tr key={i}>
              <td>{key}</td>
              <td>{Object.values(value)[0]}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  ))}
  <div>
    <h2>Final Result</h2>
    <table>
      <thead>
        <tr>
          <th>Key</th>
          <th>Value</th>
        </tr>
      </thead>
      <tbody>
        {data['Final Result'].map((item, i) => (
          <tr key={i}>
            <td>{Object.keys(item)[0]}</td>
            <td>{Object.values(item)[0]}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
</div>

      )}
    </div>
  );
};

export default App;
